(16, '2015-01-23', '', 'DiagnÃ³stico da sub-bacia do Alto Rio Verde, manancial de abastecimento de Itanhandu.', 'diagnostico-da-sub-bacia-do-alto-rio-verde-manancial-de-abastecimento-de-itanhandu', '<h2>Doe a partir de R$ 15,00</h2>\r\n<form action="https://pagseguro.uol.com.br/checkout/v2/cart.html?action=add" method="post">\r\n<input type="hidden" name="itemCode" value="9DB415492727FBC114DCCF8B874680BB" />\r\n<input type="image" name="submit"  />\r\n</form>', 'Banco Bradesco<br />\r\nAgÃªncia: 0795-1<br />\r\nConta Corrente: 21998-3<br />\r\nFv: Instituto SuperAÃ‡ÃƒO<br /><br />\r\nEnvie-nos um e-mail informando sobre o deposito e dados do recibo :)', 'R$ 0,00', 'R$ 10.000,00', '', '', 'Campanha de arrecadaÃ§Ã£o coletiva para realizaÃ§Ã£o de diagnÃ³stico socio-ambiental e econÃ´mico da Sub-Bacia do Alto Rio Verde.', '<p><strong>Por que estamos solicitando sua colabora&ccedil;&atilde;o?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A profunda estiagem que estamos vivenciando em 2014 &eacute; um alerta para toda a sociedade da import&acirc;ncia que t&ecirc;m o cuidado com nossas florestas e &aacute;guas. &Eacute; um alerta de que a Terra est&aacute; doente e precisa de cuidados.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Aqui em Itanhandu tamb&eacute;m estamos percebendo a falta d&#39;&aacute;gua e o quanto devemos voltar nossas aten&ccedil;&otilde;es para a recupera&ccedil;&atilde;o e o cuidado com os mananciais, especialmente quando s&atilde;o eles que nos abastecem, como &eacute; o caso do Rio Verde. Por isso, o Instituto SuperA&Ccedil;&Atilde;O, aderiu ao movimento proposto pela Prefeitura de implantar um Programa de Pagamento por Servi&ccedil;os Ambientais em Itanhandu. Vale destacar que esse Programa foi selecionado para receber apoio t&eacute;cnico da Ag&ecirc;ncia Nacional das &Aacute;guas - ANA. Um dos nossos compromissos assumidos junto aos parceiros &eacute; captar recursos para garantir a elabora&ccedil;&atilde;o de um diagn&oacute;stico da sub-bacia do Alto Rio Verde, passo importante para a implanta&ccedil;&atilde;o do Programa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>No que ser&atilde;o utilizados os recursos?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Quando estamos doentes, procuramos um m&eacute;dico para saber o que temos e que tratamento devemos seguir para nos curarmos. Quando precisamos iniciar uma interven&ccedil;&atilde;o no ambiente, come&ccedil;amos realizando um diagn&oacute;stico para conhecer o que acontece com o solo, as matas e as &aacute;guas da bacia. Conhecendo quem vive nessas &aacute;reas e quais s&atilde;o os principais fatores de degrada&ccedil;&atilde;o poderemos, juntos, determinar qual &eacute; a melhor forma de agir para recuperar e revitalizar a produ&ccedil;&atilde;o de &aacute;gua para o munic&iacute;pio.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Como colaborar?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A meta de arrecada&ccedil;&atilde;o para elabora&ccedil;&atilde;o do diagn&oacute;stico &eacute; de R$ 10.000,00. Todos podem colaborar, pessoas f&iacute;sicas e jur&iacute;dicas, brasileiras e estrangeiras. Basta clicar no bot&atilde;o do <strong><em>pag-seguro</em></strong> para fazer sua doa&ccedil;&atilde;o ou realizar sua contribui&ccedil;&atilde;o diretamente da conta banc&aacute;ria do Instituto SuperA&Ccedil;&Atilde;O, exclusiva para essa arrecada&ccedil;&atilde;o coletiva.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TRANSPAR&Ecirc;NCIA</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>O Instituto SuperaA&Ccedil;&Atilde;O preza pela seriedade e profissionalismo em todas a&ccedil;&otilde;es e projetos desenvolvidos. Por isso, ser&aacute; dada divulga&ccedil;&atilde;o aos valores totais arrecadados e tamb&eacute;m prestaremos contas de como esse recurso foi utilizado. As informa&ccedil;&otilde;es e mapas gerados pelo diagn&oacute;stico ser&atilde;o divulgadas em nosso site, nas escolas e espa&ccedil;os locais de participa&ccedil;&atilde;o social do munic&iacute;pio.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '1417199474.jpg', '', '', '', 'rio, verde, rio verde, recuperaÃ§Ã£o', 'S');

