(11, '2014-11-28', '', 'Projeto um', 'projeto-um', 'descriÃ§Ã£o aqui', '', 'resumo aqui', '<p>A equipe do Instituto SuperA&Ccedil;&Atilde;O fez uma visita t&eacute;cnica a Escola Agroecol&oacute;gica S&iacute;tio Esperan&ccedil;a. A Associa&ccedil;&atilde;o S&iacute;tio Esperan&ccedil;a &eacute; uma organiza&ccedil;&atilde;o da sociedade civil, independente, apartid&aacute;ria e sem fins lucrativos, estabelecida na cidade de Lambari (MG) desde julho de 2009. A sede da Associa&ccedil;&atilde;o &eacute; uma pequena fazenda localizada na zona rural de Lambari com muita &aacute;rea verde, &aacute;rvores nativas, jardins, pomares, hortas org&acirc;nicas e viveiro de mudas. A escola oferece educa&ccedil;&atilde;o formal a crian&ccedil;as entre 2 e 6 anos de idade desde 2010. As atividades da Escola s&atilde;o pautadas na Pedagogia da Sensibilidade e em atividades que estimulam o florescimento de qualidades positivas (medita&ccedil;&atilde;o, agroecologia, introdu&ccedil;&atilde;o musical, yoga, atividades l&uacute;dicas e atividades de pr&eacute;-alfabetiza&ccedil;&atilde;o).</p>\r\n\r\n<hr />\r\n<p>asdfsdfsdf</p>\r\n', '1417103882.jpg', '', '', '', 'projeto', 'S'),
(12, '2014-11-28', '', 'EspaÃ§o Verde recebe visita de alunos', 'espaco-verde-recebe-visita-de-alunos', 'Ontem dia 12 de agosto, o Instituto SuperAÃ‡ÃƒO levou os alunos do 4Âº e 5Âº ano do Projeto Tempo Integral da Escola Municipal Ana Carlos da Silva ao nosso EspaÃ§o Verde. LÃ¡ foram feitas vÃ¡rias atividades como plantio de Ã¡rvores, o ninho da Ã¡guia, produÃ§Ã£o de mudas de hortaliÃ§as e replantio de cenouras. Foi uma tarde muito agradÃ¡vel.', '', 'Ontem dia 12 de agosto, o Instituto SuperAÃ‡ÃƒO levou os alunos do 4Âº e 5Âº ano do Projeto Tempo Integral da Escola Municipal Ana Carlos da Silva ao nosso EspaÃ§o V', '<p>Ontem dia 12 de agosto, o Instituto SuperA&Ccedil;&Atilde;O levou os alunos do 4&ordm; e 5&ordm; ano do Projeto Tempo Integral da Escola Municipal Ana Carlos da Silva ao nosso Espa&ccedil;o Verde. L&aacute; foram feitas v&aacute;rias atividades como plantio de &aacute;rvores, o ninho da &aacute;guia, produ&ccedil;&atilde;o de mudas de hortali&ccedil;as e replantio de cenouras. Foi uma tarde muito agrad&aacute;vel.</p>\r\n', '1417179525.jpg', '', '', '', 'espaÃ§o, verde, espaÃ§o verde', 'S');
INSERT INTO `produtos` (`ID`, `Data`, `Dia`, `Titulo`, `Nome_URL_Amigavel`, `Resumo`, `Obs`, `SEO`, `TextFull`, `Produto`, `Tipo`, `Arquivo`, `PDF`, `KeyWords`, `Ativo`) VALUES
(15, '2015-01-22', '', 'Instituto SuperAÃ‡ÃƒO Ã© parceiro em projeto de PSA aprovado pela AgÃªncia Nacional das Ãguas.', 'instituto-superacao-e-parceiro-em-projeto-de-psa-aprovado-pela-agencia-nacional-das-aguas', 'O projeto Produtores de Ã¡gua do Alto Rio Verde: pagamento de serviÃ§os ambientais na sub-bacia de abastecimento urbano do municÃ­pio de Itanhandu, MG foi aprovado no Chamamento PÃºblico 02/2014, do Programa Produtor de Ãgua, da AgÃªncia Nacional das Ãguas. SÃ£o parceiros na implementaÃ§Ã£o do projeto: Prefeitura Municipal de Itanhandu; Instituto SuperAÃ‡ÃƒO; FundaÃ§Ã£o RogÃª; Granja Mantiqueira; Universidade Federal de ItajubÃ¡; Universidade Federal de Lavras; Sindicato Rural de Itanhandu; CBH-Rio Verde.  ', '', 'Produtores de Ã¡gua do Alto Rio Verde: pagamento de serviÃ§os ambientais na sub-bacia de abastecimento urbano do municÃ­pio de Itanhandu, MG.', '<p><strong>O Projeto</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>As previs&otilde;es de escassez de &aacute;gua para uso humano t&ecirc;m chamado a aten&ccedil;&atilde;o de pesquisadores e gestores para a conserva&ccedil;&atilde;o das &aacute;guas continentais. Diante das previs&otilde;es n&atilde;o t&atilde;o otimistas, a sociedade tem se tornado mais sens&iacute;vel &agrave; quest&atilde;o. Enquanto a economia e a sociedade exigem mais e mais &aacute;gua em suas atividades, cresce tamb&eacute;m a responsabilidade sobre a sustentabilidade deste recurso.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>O projeto <strong>Produtores de &aacute;gua do Alto Rio Verde: pagamento de servi&ccedil;os ambientais na sub-bacia de abastecimento urbano do munic&iacute;pio de Itanhandu, MG </strong>prop&otilde;e o estabelecimento do Programa Produtor de &Aacute;gua no munic&iacute;pio de Itanhandu, na Sub-bacia do Alto Rio Verde, cujos mananciais abastecem &aacute;reas rurais e a zona urbana do munic&iacute;pio. Em conson&acirc;ncia com o Manual Operativo da ANA, prop&otilde;e-se o estabelecimento dos arranjos interinstitucionais, a realiza&ccedil;&atilde;o de estudos e a capacita&ccedil;&atilde;o de atores locais. Considerando o uso m&uacute;ltiplo do recurso h&iacute;drico e o envolvimento dos usu&aacute;rios de &aacute;gua da bacia, prop&otilde;e-se ainda&nbsp; para o estabelecimento de microbacia(s) demonstrativa(s) da ado&ccedil;&atilde;o de t&eacute;cnicas de conserva&ccedil;&atilde;o de &aacute;gua e solo e pagamento de servi&ccedil;os ambientais. Como fim &uacute;ltimo, espera-se que os atores sociais locais, j&aacute; preocupados e impactados pela degrada&ccedil;&atilde;o da qualidade das &aacute;guas do Alto Rio Verde, tenham em m&atilde;os os instrumentos necess&aacute;rios para garantir n&atilde;o somente a revers&atilde;o da degrada&ccedil;&atilde;o dos recursos h&iacute;dricos do Alto Rio Verde, como a manuten&ccedil;&atilde;o, no longo prazo, da sua qualidade e quantidade para abastecimento urbano e balneabilidade.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>O projeto foi aprovado no Chamamento P&uacute;blico 02/2014, do Programa Produtor de &Aacute;gua, da Ag&ecirc;ncia Nacional das &Aacute;guas. S&atilde;o parceiros na sua implementa&ccedil;&atilde;o: Prefeitura Municipal de Itanhandu; Instituto SuperA&Ccedil;&Atilde;O; Funda&ccedil;&atilde;o Rog&ecirc;; Granja Mantiqueira; Universidade Federal de Itajub&aacute;; Universidade Federal de Lavras; Sindicato Rural de Itanhandu; CBH-Rio Verde.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>A Sub-Bacia do Alto Rio Verde </strong></p>\r\n\r\n<p style="text-align:center"><img alt="" src="data:image/png;base64," /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A Bacia Hidrogr&aacute;fica do Rio Verde est&aacute; localizada no sul de Minas Gerais possuindo &aacute;rea de drenagem de 6.891,4 km&sup2;. Integra a bacia hidrogr&aacute;fica do rio Grande e constitui a Unidade de Planejamento e Gest&atilde;o dos Recursos H&iacute;dricos (UPGRH) GD4, sendo que sua &aacute;rea corresponde a 4,25% da &aacute;rea total da bacia do rio Grande.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Desde suas nascentes, no munic&iacute;pio de Itanhandu, o Rio Verde percorre aproximadamente de 220 km, at&eacute; desaguar na represa de Furnas. A bacia do Rio Verde &eacute; constitu&iacute;da por 31 munic&iacute;pios e Itanhandu &eacute; o primeiro deles, estando integralmente inserido na bacia. Seu leito principal &eacute; composto pela uni&atilde;o de tr&ecirc;s nascentes: Rio Posses, Rio Vermelho e Rio Verde, que se localizam no alto da Serra da Mantiqueira entre o limite dos munic&iacute;pios de Itanhandu e Passa Quatro, MG, numa altitude aproximada de 2600 metros. A Bacia possui um Plano Diretor elaborado em 2010.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A Sub-bacia do Alto Rio Verde, onde se localizam as cabeceiras, possui uma &aacute;rea total de aproximadamente 30.550 hectares, ocupando 4,43% da &aacute;rea total da Bacia. &Eacute; relevante o seu bom estado de conserva&ccedil;&atilde;o, em compara&ccedil;&atilde;o com as sub bacias contiguas. Os fragmentos mais homog&ecirc;neos de Floresta Ombr&oacute;fila encontram-se ao sul da bacia, no munic&iacute;pio de Itanhandu. As cabeceiras do Rio Verde est&atilde;o inseridas na &Aacute;rea de Prote&ccedil;&atilde;o Ambiental da Serra da Mantiqueira e as &aacute;guas ainda podem ser destinadas &agrave; preserva&ccedil;&atilde;o do equil&iacute;brio natural das comunidades aqu&aacute;ticas e preserva&ccedil;&atilde;o dos ambientes aqu&aacute;ticos. Um pouco mais abaixo, o Rio Verde recebe os efluentes de carga difusa proveniente de atividades agropecu&aacute;rias e da falta de esgotamento sanit&aacute;rio adequado nos bairros rurais Paiolinho e Jardim, al&eacute;m de exercer o uso para dessedenta&ccedil;&atilde;o animal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>No Alto Rio Verde est&atilde;o localizadas tambem mais duas capta&ccedil;&otilde;es de &aacute;gua para abastecimento da sede municipal de Itanhandu, ambas localizadas abaixo dos n&uacute;cleos populacionais Jardim e Paiolinho. A capta&ccedil;&atilde;o localizada em um afluente do&nbsp; rio Verde denominado rio Imbiri, constru&iacute;da&nbsp; em 1927, abastecia a sede urbana antigamente com 2.000.000 litros/dia. Hoje, o volume de capta&ccedil;&atilde;o caiu em torno de 4 vezes, sendo de 500.000 litros dia. A diminui&ccedil;&atilde;o no volume captado &eacute; devida ao assoreamento, cuja principal fonte de sedimentos &eacute; a estrada de terra que passa &agrave; montante do ribeir&atilde;o. Apesar do estado degradado da microbacia do rio Imbiri, ainda pode ser recuperada. O outro ponto de capta&ccedil;&atilde;o de &aacute;gua utilizado atualmente, est&aacute; localizado no&nbsp; pr&oacute;prio&nbsp; Rio Verde. S&atilde;o captados 3.500.000 litros/dia que abastecem &nbsp;cerca de 5000 domic&iacute;lios ap&oacute;s passar&nbsp; por&nbsp; tratamento&nbsp; convencional&nbsp; na&nbsp; ETA&nbsp; da&nbsp; Prefeitura&nbsp; Municipal.&nbsp;&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '', 'psa, rio verde, abastecimento urbano', 'S');

